				<div className='col-xs-1' align="center">
					<div className="terminal shadow" data-bs-theme="light" align="left">
						<span class="green">
							<i class="fa-solid fa-ghost" />
							&nbsp;&nbsp;cat
						</span>{" "}
						<span class="orange">
							{" "}
